propOverview:
Property was built for the oil industry.  There is a 750' test well onsite.  The property has two enclosed wash rack, one grease rack, several separate storage areas and a separate office building.  Approximately 1 acre of the property is gravel surfaced.
This property is a sublease and expires on 2/28/21. 
Additional term can be negotiated.

The property contains the following buildings:
1200 SF metal building;
1900 SF metal building;
200 SF building;
1788 SF grease and wash rack;
1300 SF wash rack;
265 SF explosives room;
980 SF office;
1350 SF of open storage area
There are 2 Drive-In Doors.
Located off Grimmett Drive.
